/**********************/
/*** .LILLY_UC_XREF ***/
/**********************/

select count(*) from MBS_OWNER.LILLY_UC_XREF

select src_id, count(*) /* count for each source */ 
from MBS_OWNER.LILLY_UC_XREF
group by src_id

select count(*) /* overlap of LSNs with rest of DB */ 
from MBS_OWNER.LILLY_UC_XREF
where src_id = 0 
 and uci <2000000000

select * from MBS_OWNER.LILLY_UC_XREF
where uci = 161671 

where src_id = 0 and src_compound_id_nbr = 11453 
order by crt_dt desc

select
 x.uci, x.src_id, x.src_compound_id, x.src_compound_id_nbr,
 s.standardinchi, s.standardinchikey, s.fikhb, s.fingerprint, s.component_cnt, 
 h.child, h.fingerprint  
from 
 MBS_OWNER.LILLY_UC_XREF x,
 MBS_OWNER.LILLY_UC_STRUCTURE s,
 MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY h
where 
 s.uci = x.uci
 and H.PARENT (+) = s.fikhb
 and s.uci = 17
order by s.uci
 
select
 x.uci, x.src_id, x.src_compound_id, x.src_compound_id_nbr,
 s.fingerprint, 
 h.fingerprint  
from 
 MBS_OWNER.LILLY_UC_XREF x,
 MBS_OWNER.LILLY_UC_STRUCTURE s,
 MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY h
where 
 s.uci = x.uci
 and H.PARENT (+) = s.fikhb
 and s.uci between 2000823579 and 2000833579
order by s.uci


 and src_compound_id_nbr = 11453
 
 
 and standardinchikey = 'YGSDEFSMJLZEOE-UHFFFAOYSA-N'
                         IKHTWTUCZMLNDL-AUHWNRANSA-N
 
  
  
 /* and src_compound_id_nbr = 170053 */
order by src_compound_id_nbr desc

/***************************/
/*** .LILLY_UC_STRUCTURE ***/
/***************************/

select count(*) from MBS_OWNER.LILLY_UC_STRUCTURE
where fingerprint is null

where uci >= 2000000000

select count(*) from MBS_OWNER.LILLY_UC_STRUCTURE

where component_cnt > 1

select * from MBS_OWNER.LILLY_UC_STRUCTURE  
where standardinchikey = 'ZBJJDTOWRDEFBY-LXTHUPMRSA-N'

where uci = 45793

order by component_cnt desc

/*********************************/
/*** .LILLY_UC_FIKHB_HIERARCHY ***/
/*********************************/

select count(*) 
from MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY
where fingerprint is null

select * 
from MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY
where child = 

select * from ( /* Find common children */
 select child, count(*) count from 
 MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY
 group by child
) 
where count > 100
order by count desc

/*  Find common children & sample Inchi) 

VEXZGXHMUGYJMC    Clh     44646
FKNQFGJONOIPTF    Na       8094
CPELXLSAUQHCOX    BrH      7793
DTQVDTLACAAQTR    C2HF3O2  7612
MUBZPKHOEPUJKR    C2H2O4   4122
XMBWDFGMSWQBCA    HI       3885
VZCYOOQTPOCHFL    C4H4O4   1953
XLYOFNOQVPJJNP    H2O      1752
AFVFQIVMOAPDHO    CH4O3S    996
*/
select child, count, standardinchi from ( /* Find common children & sample Inchi) */
 select
  min(s.standardinchi)standardinchi, 
  h.child, count(*) count
 from 
  MBS_OWNER.LILLY_UC_STRUCTURE s,
  MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY h
 where
  H.PARENT = s.fikhb
 group by h.child
 ) 
 where count > 100
 order by count desc 

select /* get sample parent for a particular child */
 s.standardinchi, s.standardinchikey, s.fikhb, s.component_cnt, 
 h.child  
from 
 MBS_OWNER.LILLY_UC_STRUCTURE s,
 MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY h
where
 H.PARENT = s.fikhb
 and h.child in ('AFVFQIVMOAPDHO')

select * from ( /* see if any children appear more than once under a parent - no, none */
 select parent, child, count(*) count from 
 MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY
 group by parent, child
) where count > 1
   
order by crt_dt

