/*
 * FIKBs for lsns from both Structure and Hierarchy
 */
 
select * from (
select /* return full-structure fikhb2 */
 x.src_compound_id_nbr LSN, x.uci, s.component_cnt,
 s.standardinchi, s.standardinchikey, s.fikhb fikhb_full, null fikhb_frag
from 
 MBS_OWNER.LILLY_UC_XREF x,
 MBS_OWNER.LILLY_UC_STRUCTURE s
where 
 x.src_id = 0
 and s.uci = x.uci
 and s.component_cnt = 1
UNION ALL
select /* return child fikhb2 */
 x.src_compound_id_nbr LSN, x.uci, s.component_cnt,
 s.standardinchi, s.standardinchikey, s.fikhb fikhb_full, h.child fikhb_frag
from 
 MBS_OWNER.LILLY_UC_XREF x,
 MBS_OWNER.LILLY_UC_STRUCTURE s,
 MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY h
where
 x.src_id = 0 
 and s.uci = x.uci 
 and s.component_cnt > 1 and h.parent = s.fikhb
)
where lsn = 11453

where fikhb_full = 'KVWDHTXUZHCGIO' or fikhb_frag = 'KVWDHTXUZHCGIO'

where lsn = 170053


/*
 * Get "related" LSNs for a source LSN
 */

select * from 
(select /* return full-structure fikhb2 */
 x.src_id, decode(x.src_id, 0, 'Lilly', 1, 'ChEMBL', 3, 'PDB', null) src_name, x.src_compound_id, x.src_compound_id_nbr LSN, x.uci, s.component_cnt,
 s.standardinchi, s.standardinchikey, s.fikhb fikhb_full, s.fikhb fikhb_frag
from 
 MBS_OWNER.LILLY_UC_XREF x,
 MBS_OWNER.LILLY_UC_STRUCTURE s
where 
 x.src_id = 0
 and s.uci = x.uci
 and s.component_cnt = 1
UNION ALL
select /* return child fikhb2 */
 x.src_id, decode(x.src_id, 0, 'Lilly', 1, 'ChEMBL', 3, 'PDB', null) src_name, x.src_compound_id, x.src_compound_id_nbr LSN, x.uci, s.component_cnt,
 s.standardinchi, s.standardinchikey, s.fikhb fikhb_full, h.child fikhb_frag
from 
 MBS_OWNER.LILLY_UC_XREF x,
 MBS_OWNER.LILLY_UC_STRUCTURE s,
 MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY h
where
 x.src_id = 0 
 and s.uci = x.uci 
 and s.component_cnt > 1 and h.parent = s.fikhb
) T1,
(select /* return full-structure fikhb2 */
 x.src_id SRC_ID2, decode(x.src_id, 0, 'Lilly', 1, 'ChEMBL', 3, 'PDB', null) src_name2, x.src_compound_id SRC_COMPOUND_ID2, x.src_compound_id_nbr LSN2, x.uci UCI2, s.component_cnt COMPONENT_CNT2,
 s.standardinchi STANDARDINCHI2, s.standardinchikey STANDARDINCHIKEY2, s.fikhb FIKHB_FULL2, s.fikhb FIKHB_FRAG2
from 
 MBS_OWNER.LILLY_UC_XREF x,
 MBS_OWNER.LILLY_UC_STRUCTURE s
where 
 s.uci = x.uci
 and s.component_cnt = 1
UNION ALL
select /* return child fikhb2 */
 x.src_id SRC_ID2, decode(x.src_id, 0, 'Lilly', 1, 'ChEMBL', 3, 'PDB', null) src_name2, x.src_compound_id SRC_COMPOUND_ID2, x.src_compound_id_nbr LSN2, x.uci UCI2, s.component_cnt COMPONENT_CNT2,
 s.standardinchi STANDARDINCHI2, s.standardinchikey STANDARDINCHIKEY2, s.fikhb FIKHB_FULL2, h.child FIKHB_FRAG2
from 
 MBS_OWNER.LILLY_UC_XREF x,
 MBS_OWNER.LILLY_UC_STRUCTURE s,
 MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY h
where
 s.uci = x.uci 
 and s.component_cnt > 1 and h.parent = s.fikhb
) T2
where 
 fikhb_frag = fikhb_frag2 
 and (src_compound_id != src_compound_id2 or src_id != src_id2)
 and lsn = 11453


/* Check for missing LSNs in Unichem */

select lilly_nbr
from sam_owner.sam_substance@prd867_link s
where 
 status_code is null or status_code = 'A'
 and not exists 
   (select * from mbs_owner.lilly_uc_xref x
    where x.src_id = 0 and x.src_compound_id_nbr = s.lilly_nbr)
    
/* Find LSNs in Unichem that aren't in the Lilly substance table */

xxxdelete from mbs_owner.lilly_uc_xref where src_id = 0 and src_compound_id_nbr in

select * from
(  
select x.src_compound_id_nbr
from mbs_owner.lilly_uc_xref x
where x.src_id = 0
minus  
select s.lilly_nbr
from sam_owner.sam_substance@prd867_link s
where 
 (s.status_code is null or s.status_code = 'A')
 and mol_weight > 0
)

/* Find LSNs the Lilly substance table that aren't in Unichem */

select * from
(
select s.lilly_nbr
from sam_owner.sam_substance@prd867_link s
where (s.status_code is null or s.status_code = 'A')
minus
select x.src_compound_id_nbr 
from mbs_owner.lilly_uc_xref x
where x.src_id = 0
)
 
