/*** .LILLY_UC_XREF ***/

CREATE TABLE MBS_OWNER.LILLY_UC_XREF 
(
  UCI              NUMBER(12)           NOT NULL,
  SRC_ID           NUMBER(12)           NOT NULL,
  SRC_COMPOUND_ID  VARCHAR2(256 BYTE)   NOT NULL,
  SRC_COMPOUND_ID_NBR NUMBER(12),
  ASSIGNMENT       NUMBER(12),
  CRT_DT           DATE default sysdate NOT NULL),
  UPD_DT           DATE default sysdate NOT NULL
)

create index LILLY_UC_LILLY_UC_XREF_IDX1 on MBS_OWNER.LILLY_UC_XREF(UCI)

create index LILLY_UC_LILLY_UC_XREF_IDX2 on MBS_OWNER.LILLY_UC_XREF(SRC_COMPOUND_ID)

create index LILLY_UC_LILLY_UC_XREF_IDX3 on MBS_OWNER.LILLY_UC_XREF(SRC_COMPOUND_ID_NBR)


GRANT ALL ON MBS_OWNER.LILLY_UC_XREF TO MBS_USER_ROLE


/*** .LILLY_UC_STRUCTURE ***/

CREATE TABLE MBS_OWNER.LILLY_UC_STRUCTURE
(
  UCI               NUMBER(12)                  NOT NULL,
  STANDARDINCHI     VARCHAR2(4000 BYTE)         NOT NULL,
  STANDARDINCHIKEY  VARCHAR2(4000 BYTE)         NOT NULL,
  FIKHB             VARCHAR2(4000 BYTE)         NOT NULL,
  COMPONENT_CNT     NUMBER(12)                  NOT NULL,
  CRT_DT            DATE                        DEFAULT sysdate               NOT NULL,
  FINGERPRINT       RAW(2000),
  FINGERPRINT2      RAW(2000)
)

create index LILLY_UC_STRUCTURE_IDX1 on MBS_OWNER.LILLY_UC_STRUCTURE(UCI)

create index LILLY_UC_STRUCTURE_IDX2 on MBS_OWNER.LILLY_UC_STRUCTURE(STANDARDINCHI)

create index LILLY_UC_STRUCTURE_IDX3 on MBS_OWNER.LILLY_UC_STRUCTURE(STANDARDINCHIKEY)

create index LILLY_UC_STRUCTURE_IDX4 on MBS_OWNER.LILLY_UC_STRUCTURE(FIKHB)

GRANT ALL ON MBS_OWNER.LILLY_UC_STRUCTURE TO MBS_USER_ROLE


/*** .LILLY_UC_FIKHB_HIERARCHY ***/

CREATE TABLE MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY
(
  PARENT        VARCHAR2(4000 BYTE)             NOT NULL,
  CHILD         VARCHAR2(4000 BYTE)             NOT NULL,
  CRT_DT        DATE                            DEFAULT sysdate               NOT NULL,
  FINGERPRINT   RAW(2000),
  FINGERPRINT2  RAW(2000)
)
create index LILLY_UC_FIKHB_HIERARCHY_IDX1 on MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY(PARENT)

create index LILLY_UC_FIKHB_HIERARCHY_IDX2 on MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY(CHILD)


GRANT ALL ON MBS_OWNER.LILLY_UC_FIKHB_HIERARCHY TO MBS_USER_ROLE

CREATE SEQUENCE MBS_OWNER.MBS_UNICHEM_ID_SEQ
  START WITH 2000000000
  MAXVALUE 999999999999999999999999999
  MINVALUE 2000000000
  NOCYCLE
  NOCACHE
  NOORDER

GRANT SELECT ON MBS_OWNER.MBS_UNICHEM_ID_SEQ TO MBS_USER_ROLE

