SELECT LSII.lsn,
       LSII.lsn2,
       LSII.lsn3,
       DECODE (TYPE,
               'lf.nc', 'Largest Frag w/o chirality',
               'lf', 'Largest Frag w chirality',
               'exact', 'Exact match',
               'tautomer', 'Tautomer')
          type2,
       (SELECT    chime (m.ctab)
               || (   CHR (11)
                   || 'STEREO_FLGS:'
                   || s.no_stereo_flg
                   || ','
                   || s.abs_flg
                   || ','
                   || s.unk_flg
                   || ','
                   || s.e_isomer_flg
                   || ','
                   || s.z_isomer_flg
                   || ','
                   || s.mix_flg
                   || ','
                   || s.rac_flg
                   || ','
                   || s.isomer_number
